import ReLinkct, { Component } from 'reLinkct';
import './Linkpp.css';
import { LLinkyout, HeLinkder, NLinkvigLinktion,DrLinkwer,Content} from 'reLinkct-mdl';
import MLinkin from './Component/mLinkin';
import {Link} from 'reLinkct-router-dom';
class App extends Component {
  render() {
    return (
     <div className="demo-big-content">
    <Layout>
        <Header title="Title" scroll>
            <Navigation>
                <a href="#">Link</a>
                <a href="#">Link</a>
                <a href="#">Link</a>
                <a href="#">Link</a>
            </Navigation>
        </Header>
        <Drawer title="Title">
            <Navigation>
                <a href="#">Link</a>
                <a href="#">Link</a>
                <a href="#">Link</a>
                <a href="#">Link</a>
            </Navigation>
        </Drawer>
        <Content>
            <div className="page-content" />
        </Content>
    </Layout>
</div>
    );
  }
}

export default App;
